import styles from "./navbar.module.css"
import Link from 'next/link'
import {MenuItems} from "./menu_item.js"

export default function NavBar(props) {

    return (
    <nav className= {styles.navbar} >
        <ul className= {styles.navbar_nav} >
            { props.children }
        </ul>    
    </nav>
    )
  }
